    `,styles:{backgroundColor:"linear-gradient(to right, #2563eb, #4f46e5)",textColor:"white",padding:"6rem 1rem"},variables:{heroBgGradient:"bg-gradient-to-r from-blue-600 to-indigo-700",heroTextColor:"text-white",heroTitle:"Welcome to Our Website",heroSubtitle:"Discover our amazing services and take your business to the next level.",ctaPrimaryLink:"#",ctaPrimaryBg:"bg-white",ctaPrimaryText:"text-blue-600",ctaPrimaryHover:"hover:bg-gray-100",ctaPrimaryTextContent:"Get Started",ctaSecondaryLink:"#",ctaSecondaryBg:"bg-transparent",ctaSecondaryBorder:"border border-white",ctaSecondaryText:"text-white",ctaSecondaryHover:"hover:bg-white hover:text-blue-600",ctaSecondaryTextContent:"Learn More"}},{id:4,title:"Hero Section 2",description:"Hero section with an image and text.",content:`
