    `,styles:{backgroundColor:"white",textColor:"black",padding:"5rem 1rem"},variables:{heroBgColor:"bg-white",heroTitle:"Build Your Dream Website",heroTitleColor:"text-gray-900",heroSubtitle:"Our intuitive website builder makes it easy to create beautiful, responsive websites without writing code.",heroSubtitleColor:"text-gray-600",ctaPrimaryLink:"#",ctaPrimaryBg:"bg-blue-600",ctaPrimaryHover:"hover:bg-blue-700",ctaPrimaryText:"text-white",ctaPrimaryTextContent:"Get Started Free",ctaSecondaryLink:"#",ctaSecondaryBg:"bg-gray-200",ctaSecondaryHover:"hover:bg-gray-300",ctaSecondaryText:"text-gray-900",ctaSecondaryTextContent:"Watch Demo",heroImage:"img/hero1.jpg",heroImageAlt:"Hero Image"}},{id:5,title:"Services Grid",description:"A section with services in a grid layout.",content:`
